"133277":{"id":"133277","name":"A Maldição dos Chippendales","slug":"a-maldicao-dos-chippendales","original_title":"Curse of the Chippendales","overview":"Os homens musculosos dos Chippendales conquistaram os corações, mentes e dólares da década de 1980 com seus punhos e colarinhos icônicos.","first_air_date":"2021-09-24","episode_run_time":50,"vote_average":6,"number_of_seasons":1,"number_of_episodes":4,"created_by":[],"production_companies":["Lightbox Entertainment"],"genres":["Documentário"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/6B3Jz9BcrWnOVjLo3xnDJWjfv5F.jpg","poster_path":"https://image.tmdb.org/t/p/original/mE4mtyVEYZNiYrsT1keMIjhQbpy.jpg","cast":[],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/mE4mtyVEYZNiYrsT1keMIjhQbpy.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/mE4mtyVEYZNiYrsT1keMIjhQbpy.jpg","air_date":"2021-09-24","episode_count":4,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Tira! Tira! Tira!","overview":"No final dos anos 70, em Los Angeles, as festas são intensas, discoteca é um sucesso e um clube em dificuldades procura a próxima grande novidade. Os Chippendales e os empresários novatos por trás deles entram em cena e sua equipe heterogênea de dançarinos transforma o sonho da \"Playboy para as mulheres\" em um show de strip masculino atrevido.","air_date":"2021-09-24","runtime":49,"still_path":"https://image.tmdb.org/t/p/original/fWQhbZgPRlzli7Hnhz0Qt0XzeXy.jpg","vote_average":0},"2":{"name":"Envolvidos com Homens","overview":"O negócio dos Chippendales cresce e faz a marca alcançar o mainstream. A trupe chega à Nova York com um show esgotado e os Chippendales se tornam os queridinhos dos programas de entrevistas, com uma turnê de enorme sucesso. Milhões de dólares chegam de mercadorias, com corpos torneados adornando calendários nos quartos das mulheres em todo o país.","air_date":"2021-09-24","runtime":47,"still_path":"https://image.tmdb.org/t/p/original/mY1PhAQ3mXMC4FyyRMdHctK6K6X.jpg","vote_average":0},"3":{"name":"Grana após Grana","overview":"A força motriz por trás de Chippendales está morta. Sem provas e sem pistas, o caso não dá em nada. Mas o show tem que continuar, e as mulheres ao redor do mundo simplesmente não se cansam, lotando arenas em todos os continentes.","air_date":"2021-09-24","runtime":44,"still_path":"https://image.tmdb.org/t/p/original/8gzufR6Qfk2UHQcIi7cKdjytuKJ.jpg","vote_average":0},"4":{"name":"Hora do Show","overview":"Os Chippendales lutam para se manter no topo, mas um plano venenoso está em andamento, além de imitadores e ações judiciais circulando. Um informante sombrio apresenta uma história improvável e o FBI lança uma operação internacional.","air_date":"2021-09-24","runtime":53,"still_path":"https://image.tmdb.org/t/p/original/bPOTRpS2YV1D3HPtvEwK3PsOOEf.jpg","vote_average":0}}}}},
"97539":{"id":"97539","name":"A Vida e a História de Madam C.J. Walker","slug":"a-vida-e-a-historia-de-madam-c-j-walker","original_title":"Self Made: Inspired by the Life of Madam C.J. Walker","overview":"Uma afro-americana que venceu a pobreza, construiu um império de produtos de beleza e se tornou a primeira milionária pelo próprio esforço. Baseado em uma história real.","first_air_date":"2020-03-20","episode_run_time":47,"vote_average":7.4,"number_of_seasons":1,"number_of_episodes":4,"created_by":[],"production_companies":["Zero Gravity Management","SpringHill Entertainment","Warner Bros. Television"],"genres":["Drama"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/8Wm4H0SmCSa0EEohkoIslDz9Uw9.jpg","poster_path":"https://image.tmdb.org/t/p/original/8WuDOSa9MKi3qUiFev0GYr4OxvD.jpg","cast":["Octavia Spencer","Tiffany Haddish","Carmen Ejogo","Garrett Morris","Kevin Carroll"],"trailer":"PxIAdqHbloM","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/sqbRMVQu44ICkpDAppbLlBqZDii.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/sqbRMVQu44ICkpDAppbLlBqZDii.jpg","air_date":"2020-03-20","episode_count":4,"overview":"Uma afro-americana que venceu a pobreza, construiu um império de produtos de beleza e se tornou a primeira milionária pelo próprio esforço. Baseado em uma história real.","vote_average":7.8,"episodes":{"1":{"name":"A briga do século","overview":"Sarah quer ser mais do que uma lavadeira e está determinada a vender o produto capilar de Addie. Quando é cruelmente rejeitada, mostra toda a sua fibra.","air_date":"2020-03-20","runtime":46,"still_path":"https://image.tmdb.org/t/p/original/taNTSW56dBkWBpf2BXs1qNbrKKA.jpg","vote_average":8.5},"2":{"name":"Cada um por si","overview":"Para concretizar seu sonho de abrir uma fábrica, Sarah depende do apoio de empresários negros da cidade e da aprovação do famoso Booker T. Washington.","air_date":"2020-03-20","runtime":50,"still_path":"https://image.tmdb.org/t/p/original/ubN8PWaqRhiaJ1zHhEdarUiqFGb.jpg","vote_average":7},"3":{"name":"A garota Walker","overview":"Os planos ambiciosos de expansão de seu império levam Sarah a Nova York. Mas traições pessoais e profissionais ameaçam tudo o que ela construiu.","air_date":"2020-03-20","runtime":49,"still_path":"https://image.tmdb.org/t/p/original/xaJe9nwZ15d53oE94YDeQt8pol5.jpg","vote_average":8.5},"4":{"name":"Um crédito para a corrida","overview":"Enfrentando problemas de saúde, questões trabalhistas e uma tragédia que atinge uma pessoa próxima, Sara toma medidas drásticas a respeito de sua vida e seu legado.","air_date":"2020-03-20","runtime":46,"still_path":"https://image.tmdb.org/t/p/original/1ZR2Fg0Til5SwcPD1vKFXt7sIwS.jpg","vote_average":7}}}}},
